column_values.new_value:
CREATE OR REPLACE PROCEDURE CMDKLTD_VIA_DESC AS
    v_observacao DIC_EXPRESSAO.DS_REVISAO%TYPE;
BEGIN
   SELECT DS_REVISAO v_observacao FROM DIC_EXPRESSAO
    ORDER BY DBMS_RANDOM.VALUE
    FETCH FIRST 1 ROWS ONLY;

    INSERT INTO CMDKLTD_CUSTOM_REFACTORED (
        NR_SEQUENCIA, DS_NAME
    ) VALUES (
        2,
        v_observacao 
    );

    COMMIT;
EXCEPTION
    WHEN OTHERS THEN
        ROLLBACK;
        RAISE_APPLICATION_ERROR(-20001, 'Erro ao cadastrar na CMDKLTD_CUSTOM_REFACTORED: ' || SQLERRM);
END CMDKLTD_VIA_DESC;
/

